import React from "react";
import Stopwatch from "./Stopwatch/Stopwatch";
import Text from "./Text/Text";

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Stopwatch />
      </header>
      <div>
        <Text />
      </div>
    </div>
  );
}

export default App;
